import React from "react";

export default function ProfileLine({ digimon, length }) {
    const percent = Number.isInteger(digimon.percentage * 100) ? 
                    digimon.percentage * 100 :
                    (digimon.percentage * 100).toFixed(2);

    return (
        <div className="line-wrapper">
            <span>{percent}%</span>
            <span className={`line ${length}`}></span>
        </div>
    );
}
